import styled from 'styled-components';

export const Info = styled.div`
  font-weight: 600;
  font-size: 2rem;
  text-transform: uppercase;
`;

export const Highlight = styled.span`
  color: #18d7dd;
  font-size: 2rem;
  font-weight: 600;
`;
